import axios from 'axios'

const LOGIN_API_BASE_URL = 'http://localhost:8080/api/v1/login'
const token_generated = ''




class TokenService{
    getTokens(pUsername, pPassword){
        return axios.post(LOGIN_API_BASE_URL, null, {
            params: {
                username: pUsername,
                password: pPassword
            }
        }).then(response => {
                // Obtenemos el valor que contiene la promesa y lo guardamos en una variable
                this.token_generated = response.data;
                // Retornamos el valor de la promesa
                return this.token_generated;
        });
    }
}


export default new TokenService()
